<select multiple="true" class="selector-duplicate zone-selector" id="duplicate-zone-selector" size="12"></select><p></p><center>	<button class="btn-green" onclick="datagridProposal.duplicateSelectedLines();needSaving=true;$('#updateLinesFlag').show();" id="dupeline">Duplicate</button>	<button class="btn-red" onclick='$("#dialog-window").dialog("destroy");' id="dupelinecancel">Cancel</button>	<br/><br/>	<div style="height: 40px; width:100%;">		<span id="updateLinesFlag"> &nbsp; <i class="fa fa-spinner fa-spin fa-fw fa-3x" aria-hidden="true" style="color: #444; opacity: .5"></i></span>	</div></center><script>	$('#dupeline,#dupelinecancel').button();	$('#updateLinesFlag').hide();    $('#duplicate-zone-selector').html('');	$('#zone-selector option[value!= DMA]').each(function(){		if($(this).val() in zonesArray){			if(zonesArray[$(this).val()].isdma === 'NO'){				$('#duplicate-zone-selector').append($("<option></option>").attr("value", $(this).val()).text($(this).text()));			}		}	});        </script>